import React from 'react';
import Authorization from '../Authorization/Authorization';



function Home(props) {

    localStorage.setItem('nameAuth', "s");

    const nameAuth = localStorage.getItem('nameAuth');

    console.log('nameAuth ', nameAuth);




    return(
         <div>
                <div className="">
                    HOME
                </div>
            {
                nameAuth === null || nameAuth === '' || nameAuth === undefined ?
                    <Authorization />
                    : <div> Добрый день, {nameAuth}! </div>
            }
            


                
        </div>
    )
}

export default Home
